data = "ਕਸੇ ਰਾ ਨ ਗਸ਼ਤੀਦ ਮਕਸੂਦ ਕਾਮ ॥੮੯॥"
page = 1404

[[content]]
asset = "DSKO"
type = "translation"
language = "en"
data = "But none came out to be victorious.(89)"

[[content]]
