type = "translation"
language = "pa"
data = "ਪਰ ਕਿਸੇ ਨੂੰ ਵੀ ਸਫਲਤਾ ਪ੍ਰਾਪਤ ਨਾ ਹੋ ਸਕੀ ॥੮੯॥"